description:
mLooks3 - 30 Movie Looks for FCPX
mLooks3 is a professional plugin that turns your flat shots into real Hollywood blockbusters within a few clicks. Designed and built from scratch exclusively for Final Cut Pro X, these grades are extremely efficient and easy to use. It doesn't matter if you work with RED's RAW or Canon's H264 files - mLooks3 is a way of giving them a quality color grading every time.

